`;

const Image = styled.section`
margin-top: 1em;
`;

const Hero = ( {textOne, textTwo,image} ) => {
  return(
    <React.Fragment> 
    <Text textOne = {textOne}> {textOne} </Text>
    <Text textTwo = {textTwo}> {textTwo} </Text>
    <img src ="/images/1.png" /> 
    </React.Fragment>
  )
}

export default Hero;
